import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule} from '@angular/common/http';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { MilitarListComponent } from './militar-list/militar-list.component';
import { EnderecoListComponent } from './endereco-list/endereco-list.component';
import { CreateMilitarComponent } from './create-militar/create-militar.component';
import { FormsModule } from '@angular/forms';
import { HomeComponent } from './home/home.component';
import { UpdateMilitarComponent } from './update-militar/update-militar.component';
import { UpdateEnderecoComponent } from './update-endereco/update-endereco.component';
import { CreateEnderecoComponent } from './create-endereco/create-endereco.component';
import { MilitarDetailsComponent } from './details-militar/details-militar.component';
import { EnderecoDetailsComponent } from './details-endereco/details-endereco.component';


@NgModule({
  declarations: [
    AppComponent,
    MilitarListComponent,
    EnderecoListComponent,
    CreateMilitarComponent,
    HomeComponent,
    UpdateMilitarComponent,
    UpdateEnderecoComponent,
    CreateEnderecoComponent,
    UpdateMilitarComponent,
    MilitarDetailsComponent,
    EnderecoDetailsComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    BrowserAnimationsModule,
    HttpClientModule,
    FormsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
